import { BrowserRouter, Route } from "react-router-dom";
import Signin from "./components/signin";
import Home from "./components/home";
function App() {
  return (
    <BrowserRouter>
      <Route exact path="/signin" element={<Signin />}></Route>
      <Route path="/home" element={<Home />}></Route>
    </BrowserRouter>
  );
}

export default App;
